import React from 'react';
import { Div, Img } from './signin';

const SignIn = () => {

    return (
        <Div container>
            <Div info>
                <Div className="logo" img>
                    <Img src={process.env.PUBLIC_URL + '/main-logo.png'}/>
                </Div>
                <div className="user-info">
                    <form id="login-form" action="/auth/login" method="post">
                        <div className="input-group">
                            <input id="email" type="email" name="email" required autoFocus />
                        </div>
                        <div className="input-group">
                            <input id="password" type="password" name="password" required />
                        </div>
                        <a id="join" href="/join" className="btn">회원가입</a>
                        <button id="login" type="submit" className="btn">로그인</button>
                        <a id="kakao" href="/auth/kakao" className="btn">카카오톡</a>
                    </form>
                </div>
            </Div>
        </Div>
    );
};

export default SignIn;
